import React, { Component } from 'react';

class About extends Component {
    render() {
        return(
            <div className="condiv">
                <h1 className="subtopic"></h1>
                <h1>About</h1>
                <br />
                <h3>Hello, I am Mitch Hoesing.</h3>
                <p>

                    <br /><br />

                   My hobbies include disc golfing, programming, running, weight lifting, cycling, reading, video gaming,
                   garage sales, cooking, meditating, photography, art, biking and fishing.
                   I am open to other hobbies as well as I enjoy diving into new subjects and learning.
                </p>
            </div>
        )
    }
}

export default About
